import React from 'react';
import {Link} from "react-router-dom";


export default function ListItems({listItems,listType,handleAction}) {
    const bucketList = () => {
        let h= [];
        listItems.map((item,index)=>{
                h.push(listType ? 
                <Link to={`/${item.bucketID}`} key={index}>
                  <li> 
                    {item.title}<button onClick={(e)=>handleAction(e,item.bucketID)}>D</button>
                  </li>
                  </Link>:
                  <li key={index}><input type="checkbox" /> {item.title} <button onClick={(e)=>handleAction(e,item.todoID)}>D</button> <button onClick={(e)=>handleAction(e,item.bucketID)}>E</button></li>
              )
            })
            return h; 
    }
    return (
    listItems ? <ul className="list-unstyled">
          {bucketList()}
    </ul> : null
    )
}
